import "./App.css"
import {Box,HStack,Input, Alert } from "@chakra-ui/react";
import CadastroPaciente from "./CadastroP/cadasPaciente";
import React, { useEffect, useState} from "react";
import axios from "axios";
import "./App.css";
import { PiMagnifyingGlassLight } from "react-icons/pi";




import './CadastroP/cadasPac.css';


function App(){

  
  const url = "http://localhost:8003/questions";
  
  const [posts, setPosts] = useState('');
  const [selectedQuestions, setSelectedQuestions] = useState([]);
  const [cpfInput, setCpfInput] = useState("");
  const [postData, setPostData] = useState();
  console.log(postData)
  const [showError, setShowError] = useState(false);

  function searchByCpf(cpf) {
    setShowError(false);
  
    axios
      .get(`http://localhost:8003/cadastro?cpf=${cpf}`)
      .then((response) => {
        const data = response.data;
        if (data.length > 0) {
         
          const matchingResult = data.find((item) => item.cpf === cpf);
  
          if (matchingResult) {
            setPostData(matchingResult); 
          } else {
            setShowError(true); 
          }
        } else {
          setShowError(true); 
        }
      })
      .catch((error) => {
        console.error(error);
        setShowError(true);
      });
  }
  
  useEffect(() => {
    if (cpfInput) {
      searchByCpf(cpfInput);
    }
  }, [cpfInput]);



  const handlePergunta = (e) => {
    const isChecked = e.target.checked;
    const questionId = e.target.value;
    
 
    setSelectedQuestions(
      isChecked
        ? [...selectedQuestions, questionId,]
        : selectedQuestions.filter((id) => id !== questionId,)
    );
  };



  function getUser() {
    axios.get(url)
      .then((response) => {
        setPosts(response.data);
      })
      .catch((error) => console.log(error));
  }


  useEffect(() => {
    getUser()
  }, []);


  async function sendDataToBackend() {
    try {
      const dataToSend = selectedQuestions.map((questionId) => ({
        perguntaId: questionId,
        pergunta: posts.find((post) => post._id === questionId).perguntas,
        //cpf: cpfInput, // Include CPF in the data being sent
      }));

      const response = await axios.post("http://localhost:8003/selecao", {
        selectedQuestions: dataToSend,
      });

      console.log("Data sent to backend:", response.data);
      alert("Perguntas enviadas com sucesso!");
      // Clear data or redirect after successful submission
    } catch (error) {
      console.error("Error sending questions:", error);
      alert("Ocorreu um erro ao enviar as perguntas. Tente novamente mais tarde.");
    }
  }



  return(
        <div className="App" >
           <div>
      <Box w="100%" ml="15%" mt="5%">
        <Input
          className="wrap-input"
          id="cpfInput"
          value={cpfInput}
          onChange={(e) => setCpfInput(e.target.value)}
          />

        <PiMagnifyingGlassLight onClick={() => searchByCpf(cpfInput)} />
      </Box>
          <p>
            {showError && (
              <Alert status="error">Usuário não encontrado no banco de dados.</Alert>
            )}
          </p>
      {postData && (
        <div key={postData._id}>
          <p>CPF: {postData.cpf}</p>
          <p>Nome: {postData.name}</p>
        </div>
      )}

    
    </div>
          <div className="cont">
            <center><h2 >Selecionar Pergunta</h2></center>
              <HStack spacing="4">
             <Box>

             </Box>
                <Box w="10%"  mr="15%" mt="5%">
                  <p htmlFor="cpf">Cadastrar Paciente</p>
                    <CadastroPaciente/>
                  </Box>
              </HStack>
        </div><br></br><br></br>
        <div className="perguntas">
          {posts.length === 0 ? (
            <p>Carregando...</p>
          ) : (
            posts.map((post) => (
              <div className="perguntas" key={post._id}>
              <p>{post.perguntas}</p>
              <input 
                type="checkbox"
                id={post._id} 
                value={post._id}
                checked={selectedQuestions.includes(post._id)}
                onChange={handlePergunta}
              />
            </div>
            ))
          )}
        </div>
     
        <div className="container-Finalizar-form-btn">
                <button className="Finalizar-form-btn" onClick={sendDataToBackend} >Finalizar</button>
          </div>

    </div>
  )
}

export default App
